import React from "react";
import "./SideBar.css";

const SideBar = () => {
  return (
    <div className="SideBar">
      <NavLink>
        to={{ pathname: `${BASE_URL}/nodes` }} activeClassName="active"
        className="SubListItem">Nodes
      </NavLink>
    </div>
  );
};

export default SideBar;
